import list from "../components/Loglist";
import { TollContext } from "../../shared/context/toll-context";
import './Toll.css'
const Tolls = ()  => {
    const toll=useContext(TollContext)
    return (
        <table>
            <thead>
         <tr>
            <th>TOLL NAME</th>
            <th>CAR/JEEP/VAN</th>
            <th>DATE/LCV</th>
            <th>TRUCK/BUS</th>
            <th>HEAVY VEHICLE</th>
         </tr>
        </thead>
        <Tolllist logs={toll.tolls}></Tolllist>
        </table>
    )
}

export default Tolls;
